using CommunityToolkit.Mvvm.ComponentModel;
using MauiAppVisit.Model;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace MauiAppVisit.ViewModel
{
    public partial class LocationDetailsViewModel : ObservableObject
    {
        private int id;
        private List<LocationDetails> locationDetails = new List<LocationDetails>();

        [ObservableProperty]
        private string _descriptionPlace;

        [ObservableProperty]
        private byte[] _imagePlaceByte;

        public LocationDetailsViewModel(string id)
        {
            this.id = Convert.ToInt32(id);
            CriarBaseParaTeste();
            GetLocationDetailsById();
        }

        private void CriarBaseParaTeste()
        {
            var location1 = new LocationDetails 
            {
                Id = 1,
                DescriptionPlace = "O Museu de Arte Moderna da Bahia está localizado no Solar do Unhão, um sítio histórico do século XVIII, às margens da Baía de Todos os Santos em Salvador. Para saber mais sobre o MAM, acesse o site",
                ImagePlace = ""
            };
            var location2 = new LocationDetails
            {
                Id = 2,
                DescriptionPlace = "teste museu nautico",
                ImagePlace = ""
            };
            locationDetails.Add(location1);
            locationDetails.Add(location2);
        }

        private void GetLocationDetailsById()
        {
            DescriptionPlace = locationDetails.Where(x => x.Id == id).Select(x => x.DescriptionPlace).FirstOrDefault();
            ImagePlaceByte = Convert.FromBase64String(locationDetails.Where(x => x.Id == id).Select(x => x.ImagePlace).FirstOrDefault());
        }
    }
}
